import React from 'react';


function Contactitem(props){

        return(
            <tr>
                <th scope="row">1</th>
                <td>{props.name}</td>
                <td>Otto</td>
                <td>
                    <span style={{cursor:'pointer'}} className="badge badge-danger font-weight-bold p-2">
                        &times;
                    </span>
                </td>
            </tr>
        )

}

export default Contactitem;
